export default function Price(props) {
  return (
    <div className={props.styles}>
                    <p className={props.finalPriceStyles}>₹{props.finalPrice}</p>
                    <p className={props.cutPriceStyles}>₹{props.cutPrice}</p>
                </div>
  )
}
